import React, { useState, useEffect } from "react";
import { Row, Col, Container } from "react-bootstrap";
import {BsLink} from "react-icons/bs"
import Navigation from "../Component/Navigation"
import Footer from "./Footer";

const Blog = () => {
 
  return (
    <>
     <Row><Navigation /></Row>
     <Container ></Container>
     <Row><Footer /></Row>
    </>
  );
};
export default Blog;
